    "2016-04-29T21:04:44.976346",nt"name": "dungeness-crab-postmpa-cpfv-fishery-north-central-region-ds1109",nt"isopen":
    false,nt"url": null,nt"notes": "This data set is a part of Ecotrust's project
    entitled: Establishing a Spatial and Economic Baseline and Assessing Initial Changes
    in the California North Central Coast CPFV Fisheries. This project is a component
    of the California North Central Coast Marine Protected Area Baseline Monitoring
    Project that is designed to characterize the ecological and socioeconomic conditions
    and changes within the North Central Coast Region since MPA implementation. The
    North Central Coast study region extends from the north at Alder Creek to the south
    at Pigeon Point. This data set consists of data collected in the summer of 2011
    from fisheries mapping interviews conducted with CPFV operators in the California
    North Central Coast in 2010. During interviews fishermen were asked to map their
    fishing grounds for 2010 and determine the relative importance of each fishing ground
    by allocating 100 pennies across their fishing grounds for this specific fishery.
    The spatial data from these interviews were then combined through an aggregation
    process where the weighted fishing grounds each fisherman gave were further weighted
    by their estimated gross economic revenue from the Dungeness crab fishery in 2010.
    This created spatial data sets for each port for this fishery. For regional or all
    port data sets, port level data was aggregated by weighting each port by the ports
    total number of fish caught for this fishery in 2010 which was taken from California
    Department of Fish and Wildlife CPFV logbook data. This data set represents the
    spatial extent and relative value of Dungeness crab CPFV fishing grounds for the
    North Central Coast Region in the year 2010.",nt"license_title": null,nt"extras":
